import React from 'react'
import FooterStyles from './Footer.styled';

const Footer = () => {
    return (
        <FooterStyles>
            <p>Copyright 2020 Clayton Homes. <br />All Rights reserved.</p>
        </FooterStyles>
    )
}

export default Footer
